import { Button, Card, CardActions, CardContent, Typography } from '@mui/material';
import '../../App.css';
import Header from '../utils/Header';
import Grid from '@mui/material/Grid2';
import Footer from '../utils/Footer';
import config from '../../config';

function Form ({ navigate }) {
  const handleClick = () => {
    navigate('landingPage')
  };

  return (
    <div style={{ width: '100%', height: '100vh', backgroundColor: config.colors.primary }}>
      <Header navigate={handleClick} />
      <div style={{ width: '100%', height: '90%', display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor: config.colors.primary }}>
        <Card sx={{ minWidth: 275, width: '50%', height: '50vh', minHeight: 200 }}>
          <CardContent>
            <Typography gutterBottom sx={{ color: 'text.secondary', fontSize: 14 }}>
              Word of the Day
            </Typography>
            <Typography sx={{ color: 'text.secondary', mb: 1.5 }}>adjective</Typography>
            <Typography variant="body2">
              well meaning and kindly.
              <br />
              {'"a benevolent smile"'}
            </Typography>
          </CardContent>
          <CardActions style={{ width: '100%', display: 'flex', justifyContent: 'flex-end', alignItems: 'flex-end' }}>
            <Button size="small">Learn More</Button>
          </CardActions>
        </Card>
      </div>
      <Footer />
    </div>
  );
}

export default Form;
